                    let numbersSection = document.querySelector('.home-page__numbers'),
                        numbersContainer = numbersSection.querySelector('.container');

                    let numbersLine = numbersSection.querySelector('.numbers__body .top-description__line'),
                        numbersTopText = numbersSection.querySelector('.body__top-description'),
                        numbersItems = numbersSection.querySelector('.body__numbers-items .numbers-items__item:first-child'),
                        offsetNumbers;

                    if (window.outerWidth <= 1280) {
                        offsetNumbers = 145;
                    } else if (window.outerWidth <= 1600) {
                        offsetNumbers = 225;
                    } else {
                        offsetNumbers = 225;
                    }

                    numbersLine.style.right = -(numbersSection.getBoundingClientRect().width - numbersTopText.getBoundingClientRect().right) + 'px';
                    numbersLine.style.width = (numbersSection.getBoundingClientRect().width - numbersItems.getBoundingClientRect().left - offsetNumbers) + 'px';
