<?php if ( have_rows( 'directions' ) ) { ?>
    <?php while ( have_rows( 'directions' ) ) { the_row(); ?>
        <section class="home-page__directions" id="directions-anchor">
            <div class="directions__body">
                <div class="container">
                    <h4>НАПРАВЛЕНИЯ</h4>
                </div>

                <div class="body__items">
                    <?php $directions_item = get_sub_field( 'directions-item' ); ?>

                    <?php if ( $directions_item ) { ?>
                        <?php foreach ( $directions_item as $post_ids ) { ?>
                            <a class="items__item" href="<?php echo get_permalink( $post_ids ); ?>">
                                <p class="item__title"><?php echo get_the_title( $post_ids ); ?></p>
                                <div class="item__desktop-image">
                                    <img src="<?php the_field( 'image-desktop', $post_ids ); ?>" />
                                    <img class="glitch-for-image" src="<?php the_field( 'image-desktop', $post_ids ); ?>" />
                                </div>
                                <div class="item__mobile-image">
                                    <img src="<?php the_field( 'image-mobile', $post_ids ); ?>" />
                                    <img class="glitch-for-image" src="<?php the_field( 'image-mobile', $post_ids ); ?>" />
                                </div>
                            </a>
                        <?php } ?>
                    <?php } ?>
                </div>
            </div>

            <script>
                document.addEventListener( 'DOMContentLoaded', function () {
                    let directionsSection = document.querySelector('.home-page__directions'),
                        directionsContainer = directionsSection.querySelector('.container');

                    let imageAnimate = directionsSection.querySelectorAll('.item__desktop-image');

                    imageAnimate.forEach(element => {
                        let parentElement = element.closest('.items__item');

                        parentElement.addEventListener('mouseenter', () => {
                            element.querySelector('.glitch-for-image').classList.add('animate');
                        });

                        parentElement.addEventListener('mouseleave', () => {
                            element.querySelector('.glitch-for-image').classList.remove('animate');
                        });
                    });
                });
            </script>
        </section>
    <?php } ?>
<?php } ?>

