        <script>
            document.addEventListener( 'DOMContentLoaded', function () {
                let ticketsSection = document.querySelector('.home-page__tickets'),
                    ticketsContainer = ticketsSection.querySelector('.container');

                let ticketsItems = ticketsSection.querySelectorAll('.tickets__body .items__item.not-empty');

                if (window.outerWidth <= 1024) {
                    ticketsItems.forEach((ticketsItem, index) => {
                        let name = ticketsItem.querySelector('.item__title'),
                            line = ticketsItem.querySelector('.item__line'),
                            info = ticketsItem.querySelector('.item__info');

                        info.setAttribute('data-height', info.offsetHeight);
                        info.setAttribute('data-paddingTop', 25);

                        if (index !== 0) {
                            info.style.height = 0 + 'px';
                            info.style.paddingTop = 0 + 'px';
                        } else {
                            ticketsItem.classList.add('open');
                        }

                        const closeOthers = () => {
                            ticketsItems.forEach((otherItem) => {
                                if (otherItem !== ticketsItem) {
                                    const otherInfo = otherItem.querySelector('.item__info');
                                    otherItem.classList.remove('open');
                                    otherInfo.style.height = 0 + 'px';
                                    otherInfo.style.paddingTop = 0 + 'px';
                                }
                            });
                        };

                        const openCurrent = () => {
                            closeOthers();
                            ticketsItem.classList.add('open');
                            info.style.height = info.getAttribute('data-height') + 'px';
                            info.style.paddingTop = info.getAttribute('data-paddingTop') + 'px';
                        };

                        name.addEventListener('click', openCurrent);
                        line.addEventListener('click', openCurrent);
                    });
                } else {
                    if (ticketsItems.length > 0) {
                        ticketsItems[0].classList.add('active');
                    }

                    ticketsItems.forEach(ticketsItem => {
                        let line = ticketsItem.querySelector('.item__line');
                        let title = ticketsItem.querySelector('.item__title');
                        let info = ticketsItem.querySelector('.item__info');

                        // Функция для добавления класса .active
                        const activateItem = () => {
                            if (ticketsItems[0].classList.contains('active')) {
                                ticketsItems[0].classList.remove('active');
                            }
                            ticketsItem.classList.add('active');
                        };

                        // Функция для удаления класса .active
                        const deactivateItem = () => {
                            ticketsItem.classList.remove('active');
                            if (![...ticketsItems].some(item => item.classList.contains('active'))) {
                                ticketsItems[0].classList.add('active');
                            }
                        };

                        // Ховер на .item__line и .item__title
                        line.addEventListener('mouseenter', activateItem);
                        title.addEventListener('mouseenter', activateItem);

                        // Ховер на .items__item (для .item__info)
                        ticketsItem.addEventListener('mouseenter', () => {
                            if (ticketsItem.classList.contains('active')) {
                                // Если элемент уже активен, ничего не делаем
                                return;
                            }
                        });

                        // Уход с .items__item
                        ticketsItem.addEventListener('mouseleave', deactivateItem);
                    });
                }
            });
        </script>
    </section>
<?php } ?>

